import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default function tableHeader() {
    return (
    <div>
        <table className="tableHeader">
            <thead>
                    <th>ID:</th>
                    <th>NAME:</th>
                    <th>DEPARTMENT:</th>
                    <th>ROLE:</th>
                    <th>EMAIL:</th>
            </thead>
        </table>
    </div>
    )
};
